import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import Title from './components/Title/Title';
import Buttons from './components/Buttons/Buttons';
import Section from './components/Section/Section';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Buttons content="Save"/>
    <Buttons content="Cancel"/>
    <Buttons content="Renting"/>
    <Buttons content="Buy"/>
    <Buttons content="Set"/>
    <Buttons content="Action"/>

    <Title content="Dảk Dảk"/>
    <Title content="Bủh Bủh"/>
    <Title content="Lờ Mao"/>
    <Title content="Dậy đi ông cháu ơi"/>
    <Title content="Còn cái nịt"/>

    <Section title="A Simple Component" paragraph="React components implement a render() method that takes input data and returns what to display. This example uses an XML-like syntax called JSX. Input data that is passed into the component can be accessed by render() via this.props." src='https://cdn3.dhht.vn/wp-content/uploads/2021/12/3-lmao-la-gi-tong-hop-30-hinh-meme-hot-trend-nhat-hien-nay.jpg'/>
  </React.StrictMode>
);
